import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './styles/Navbar.css'; // Ensure you have the necessary CSS here

const DashboardNavbar = () => {
    const navigate = useNavigate();

    // Function to handle logout
    const handleLogout = () => {
        // Clear token or session (localStorage or any state)
        localStorage.removeItem('token');
        // Redirect to login page
        navigate('/login');
    };

    return (
        <nav className="navbar navbar-expand-md navbar-light bg-white shadow-lg">
            <div className="container-fluid">
                {/* Logo or App Name */}
                <Link className="navbar-brand text-gray-800 font-bold" to="/dashboard">Rouge Dashboard</Link>

                {/* Mobile Menu Button */}
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                {/* Navbar Links */}
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav mx-auto mb-2 mb-md-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/dashboard">Dashboard</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/saved-looks">My Saved Looks</Link>
                        </li>
                       
                        <li className="nav-item">
                            <Link className="nav-link" to="/occasions">Occasions</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/profile">Profile</Link>
                        </li>
                    </ul>
                </div>

                {/* Logout Button */}
                <div className="d-flex">
                    <button className="nav-link btn-logout" onClick={handleLogout}>Logout</button>
                </div>
            </div>
        </nav>
    );
};

export default DashboardNavbar;
